var title_f3_62_4067="Core components rehab A";
var content_f3_62_4067=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60257%7ECARD%2F73513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60257%7ECARD%2F73513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Core components of cardiac rehabilitation/secondary prevention programs: Patient assessment, nutritional counseling, and weight management",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Patient assessment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Medical history: Review current and prior cardiovascular medical and surgical diagnoses and procedures (including assessment of left ventricular function); comorbidities (including peripheral arterial disease, cerebral vascular disease, pulmonary disease, kidney disease, diabetes mellitus, musculoskeletal and neuromuscular disorders, depression, and other pertinent diseases); symptoms of cardiovascular disease; medications (including dose, frequency, and compliance); date of most recent influenza vaccination; cardiovascular risk profile; and educational barriers and preferences. Refer to each core component of care for relevant assessment measures.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Physical examination: Assess cardiopulmonary systems (including pulse rate and regularity, blood pressure, auscultation of heart and lungs, palpation and inspection of lower extremities for edema and presence of arterial pulses); post-cardiovascular procedure wound sites; orthopedic and neuromuscular status; and cognitive function. Refer to each core component for respective additional physical measures.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Testing: Obtain resting 12-lead ECG; assess patient's perceived health-related quality of life or health status. Refer to each core component for additional specified tests.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Document the patient assessment information that reflects the patient's current status and guides the development and implementation of (1) a patient treatment plan that prioritizes goals and outlines intervention strategies for risk reduction, and (2) a discharge/follow-up plan that reflects progress toward goals and guides long-term secondary prevention plans.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Interactively, communicate the treatment and follow-up plans with the patient and appropriate family members/domestic partners in collaboration with the primary healthcare provider.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        In concert with the primary care provider and/or cardiologist, ensure that the patient is taking appropriate doses of aspirin, clopidogrel,",
"        <sub>",
"         &beta;",
"        </sub>",
"        -blockers, lipid-lowering agents, and ACE inhibitors or angiotensin receptor blockers as per the ACC/AHA, and that the patient has had an annual influenza vaccination.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient treatment plan: Documented evidence of patient assessment and priority short-term (ie, weeks-months) goals within the core components of care that guide intervention strategies. Discussion and provision of the initial and follow-up plans to the patient in collaboration with the primary healthcare provider.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Outcome report: Documented evidence of patient outcomes within the core components of care that reflects progress toward goals, including whether the patient is taking appropriate doses of aspirin, clopidogrel,",
"        <sub>",
"         &beta;",
"        </sub>",
"        -blockers, and ACE inhibitors or angiotensin receptor blockers as per the ACC/AHA, and whether the patient has had an annual influenza vaccination (and if not, documented evidence for why not), and identifies specific areas that require further intervention and monitoring.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Discharge plan: Documented discharge plan summarizing long-term goals and strategies for success.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Nutritional counseling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Obtain estimates of total daily caloric intake and dietary content of saturated fat, trans fat, cholesterol, sodium, and nutrients.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess eating habits, including fruit and vegetable, whole grain, and fish consumption; number of meals and snacks; frequency of dining out; and alcohol consumption.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Determine target areas for nutrition intervention as outlined in the core components of weight, hypertension, diabetes, as well as heart failure, kidney disease, and other comorbidities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prescribe specific dietary modifications aiming to at least attain the saturated fat and cholesterol content limits of the Therapeutic Lifestyle Change diet. Individualize diet plan according to specific target areas as outlined in the core components of weight, hypertension, and diabetes (as outlined in this table), as well as heart failure and other comorbidities. Recommendations should be sensitive and relevant to cultural preferences.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Educate and counsel patient (and appropriate family members/domestic partners) on dietary goals and how to attain them.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Incorporate behavior change models and compliance strategies into counseling sessions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient adheres to prescribed diet.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient understands basic principles of dietary content, such as calories, fat, cholesterol, and nutrients.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A plan has been provided to address eating behavior problems.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Weight management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Measure weight, height, and waist circumference. Calculate body mass index (BMI).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        In patients with BMI &gt;25 kg/m",
"        <sup>",
"         2",
"        </sup>",
"        and/or waist &gt;40 inches in men (102 cm) and &gt;35 inches (88 cm) in women*:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Establish reasonable short-term and long-term weight goals individualized to the patient and his or her associated risk factors (eg, reduce body weight by at least 5 percent and preferably by &gt;10 percent at a rate of 1 to 2 lb/wk over a period of time up to sixmonths).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Develop a combined diet, physical activity/exercise, and behavioral program designed to reduce total caloric intake, maintain appropriate intake of nutrients and fiber, and increase energy expenditure. The exercise component should strive to include daily, longer distance/duration walking (eg, 60 to 90 minutes).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Aim for an energy deficit tailored to achieve weight goals (eg, 500 to 1000 kcal/day).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Short-term: Continue to assess and modify interventions until progressive weight loss is achieved. Provide referral to specialized, validated nutrition weight loss programs if weight goals are not achieved.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-term: Patient adheres to diet and physical activity/exercise program aimed toward attainment of established weight goal.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * BMI definitions for overweight and obesity may differ by race/ethnicity and region of the world. Relevant definitions, when available, should be respectively applied.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Balady GJ, Williams MA, Ades PA, et al.&nbsp;Circulation 2007;115:2675. Copyright 2007 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Core components of cardiac rehabilitation/secondary prevention programs: Blood pressure management, lipid management, diabetes management, tobacco cessation, psychosocial management, physical activity counseling, and exercise training",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Blood pressure management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Measure seated resting blood pressure on &ge;two visits.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Measure blood pressure in both arms at program entry.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        To rule out orthostatic hypotension, measure lying, seated, and standing blood pressure at program entry and after adjustments in antihypertensive drug therapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess current treatment and compliance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess use of nonprescription drugs that may adversely affect blood pressure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide and/or monitor drug therapy in concert with primary healthcare provider as follows:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        If blood pressure is 120 to 139 mmHg systolic or 80 to 89 mmHg diastolic:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Provide lifestyle modifications, including regular physical activity/exercise; weight management; moderate sodium restriction and increased consumption of fresh fruits, vegetables, and low-fat dairy products; alcohol moderation; and smoking cessation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Provide drug therapy for patients with chronic kidney disease, heart failure, or diabetes if blood pressure is &ge;130 / &ge;80 mmHg after lifestyle modification.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        If blood pressure is &ge;140 mmHg systolic or &ge;90 mmHg diastolic:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Provide lifestyle modification and drug therapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Short-term: Continue to assess and modify intervention until normalization of blood pressure in prehypertensive patients; &lt;140 mmHg systolic and &lt;90 mmHg diastolic in hypertensive patients; &lt;130 mmHg systolic and &lt;80 mmHg diastolic in hypertensive patients with diabetes, heart failure, or chronic kidney disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-term: Maintain blood pressure at goal levels.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Lipid management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Obtain fasting measures of total cholesterol, high-density lipoprotein, low-density lipoprotein, and triglycerides. In those patients with abnormal levels, obtain a detailed history to determine whether diet, drug, and/or other conditions that may affect lipid levels can be altered.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess current treatment and compliance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Repeat lipid profiles at&nbsp;four to six&nbsp;weeks after hospitalization and at two months after initiation or change in lipid-lowering medications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess creatine kinase levels and liver function in patients taking lipid-lowering medications as recommended by NCEP.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide nutritional counseling consistent with the Therapeutic Lifestyle Change diet, such as the recommendation to add plant stanol/sterols and viscous fiber and the encouragement to consume more omega-3 fatty acids, as well as weight management counseling, as needed, in all patients. Add or intensify drug treatment in those with low-density lipoprotein &gt;100 mg/dL; consider adding drug treatment in those with low-density lipoprotein &gt;70 mg/dL.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide interventions directed toward management of triglycerides to attain non-high-density lipoprotein cholesterol &lt;130 mg/dL. These include nutritional counseling and weight management, exercise, smoking cessation, alcohol moderation, and drug therapy as per NCEP and AHA/ACC.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide and/or monitor drug treatment in concert with primary healthcare provider.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Short-term: Continue to assess and modify intervention until low-density lipoprotein is &lt;100 mg/dL (further reduction to a goal &lt;70 mg/dL is considered reasonable) and non-high-density lipoprotein cholesterol &lt;130 mg/dL (further reduction to a goal of &lt;100 mg/dL is considered reasonable).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-term: Low-density lipoprotein cholesterol &lt;100 mg/dL (further reduction to a goal &lt;70 mg/dL is considered reasonable). Non-high-density lipoprotein cholesterol &lt;130 mg/dL (further reduction to a goal of &lt;100 mg/dL is considered reasonable).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diabetes management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        From medical record review:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Confirm presence or absence of diabetes in all patients.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; If a patient is known to be diabetic, identify history of complications such as findings related to heart disease; vascular disease; problems with eyes, kidneys, or feet; or autonomic or peripheral neuropathy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        From initial patient interview:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Obtain history of signs/symptoms related to above complications and/or reports of episodes of hypoglycemia or hyperglycemia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Identify physician managing diabetic condition and prescribed treatment regimen, including:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        - Medications and extent of compliance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        - Diet and extent of compliance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        - Blood sugar monitoring method and extent of compliance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Before starting exercise:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Obtain latest fasting plasma glucose (FPG) and glycosylated hemoglobin (HbA1c).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Consider stratifying patient to high-risk category because of the greater likelihood of exercise-induced complications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Educate patient and staff to be alert for signs/symptoms of hypoglycemia or hyperglycemia and provide appropriate assessment and interventions as per the American Diabetes Association.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        In those taking insulin or insulin secretogogues:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Avoid exercise at peak insulin times.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Advise that insulin be injected in abdomen, not muscle to be exercised.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Test blood sugar levels pre- and post-exercise at each session: if blood sugar value is &lt;100 mg/dL, delay exercise and provide patient 15 g of carbohydrate; retest in 15 minutes; proceed if blood sugar value is &gt;100 mg/dL; if blood sugar value is &gt;300 mg/dL, patient may exercise if he or she feels well, is adequately hydrated, and blood and/or urine ketones are negative; otherwise, contact patient's physician for further treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Encourage adequate hydration to avoid effects of fluid shifts on blood sugar levels.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Caution patient that blood sugar may continue to drop for 24 to 48 hours after exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        In those treated with diet, metformin, alpha glucosidase inhibitors, and/or thiozolidinediones, without insulin or insulin secretogogues, test blood sugar levels prior to exercise for first 6 to 10 sessions to assess glycemic control; exercise is generally unlikely to cause hypoglycemia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Education recommendations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Teach and practice self-monitoring skills for use during unsupervised exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Refer to registered dietitian for medical nutrition therapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Consider referral to certified diabetic educator for skill training, medication instruction, and support groups.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Short-term:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Communicate with primary physician or endocrinologist about signs/symptoms and medication adjustments.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Confirm patient's ability to recognize signs/symptoms, self-monitor blood sugar status, and self-manage activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Long-term:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Attain FPG levels of 90 to 130 mg/dL and HbA1c &lt;7 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Minimize complications and reduce episodes of hypoglycemia or hyperglycemia at rest and/or with exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Maintain blood pressure at &lt;130 / &lt;80 mmHg.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Tobacco cessation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Initial encounter:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Ask the patient about his or her smoking status and use of other tobacco products. Document status as never smoked, former smoker, current smoker (includes those who have quit in the last 12 months because of the high probability of relapse). Specify both amount of smoking (cigarettes per day) and duration of smoking (number of years). Quantify use and type of other tobacco products. Question exposure to second-hand smoke at home and at work.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Determine readiness to change by asking every smoker/tobacco user if he or she is now ready to quit.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Assess for psychosocial factors that may impede success.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Ongoing contact: Update status at each visit during first&nbsp;two weeks of cessation, periodically thereafter.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        When readiness to change is not expressed, provide a brief motivational message containing the \"5 Rs\": Relevance, Risks, Rewards, Roadblocks, and Repetition.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        When readiness to change is confirmed, continue with the \"5 As\": Ask, Advise, Assess, Assist, and Arrange. Assist the smoker/tobacco user to set a quit date, and select appropriate treatment strategies (preparation):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <em>",
"         Minimal (brief)",
"        </em>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Individual education and counseling by program staff supplemented by self-teaching materials.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Social support provided by physician, program staff, family and/or domestic partner; identify other smokers in the house; discuss how to engage them in the patient's cessation efforts.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Relapse prevention: problem solving, anticipated threats, practice scenarios.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <em>",
"         Optimal (intense)",
"        </em>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Longer individual counseling or group involvement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Pharmacological support (in concert with primary physician): nicotine replacement therapy, bupropion hydrochloride.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Supplemental strategies if desired (eg, acupuncture, hypnosis).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        If patient has recently quit, emphasize relapse prevention skills.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urge avoidance of exposure to second-hand smoke at work and home.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Note: Patients who continue to smoke upon enrollment are subsequently more likely to drop out of cardiac rehabilitation/secondary prevention programs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Short-term: Patient will demonstrate readiness to change by initially expressing decision to quit and selecting a quit date. Subsequently, patient will quit smoking and all tobacco use and adhere to pharmacological therapy (if prescribed) while practicing relapse prevention strategies; patient will resume cessation plan as quickly as possible when temporary relapse occurs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Long-term: Complete abstinence from smoking and use of all tobacco products for at least 12 months (maintenance) from quit date. No exposure to environmental tobacco smoke at work and home.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Psychosocial management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Identify psychological distress as indicated by clinically significant levels of depression, anxiety, anger or hostility, social isolation, marital/family distress, sexual dysfunction/adjustment, and substance abuse (alcohol or other psychotropic agents), using interview and/or standardized measurement tools.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Identify use of psychotropic medications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Offer individual and/or small group education and counseling on adjustment to heart disease, stress management, and health-related lifestyle change. When possible, include family members, domestic partners, and/or significant others in such sessions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Develop supportive rehabilitation environment and community resources to enhance the patient's and the family's level of social support.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Teach and support self-help strategies.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        In concert with primary healthcare provider, refer patients experiencing clinically significant psychosocial distress to appropriate mental health specialists for further evaluation and treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Emotional well-being is indicated by the absence of clinically significant psychological distress, social isolation, or drug dependency.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient demonstrates responsibility for health-related behavior change, relaxation, and other stress management skills; ability to obtain effective social support; compliance with psychotropic medications if prescribed; and reduction or elimination of alcohol, tobacco, caffeine, or other nonprescription psychoactive drugs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Arrange for ongoing management if important psychosocial issues are present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physical activity counseling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess current physical activity level (eg, questionnaire, pedometer) and determine domestic, occupational, and recreational needs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Evaluate activities relevant to age, gender, and daily life, such as driving, sexual activity, sports, gardening, and household tasks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assess readiness to change behavior, self-confidence, barriers to increased physical activity, and social support in making positive changes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide advice, support, and counseling about physical activity needs on initial evaluation and in follow-up. Target exercise program to meet individual needs (see Exercise Training section of table). Provide educational materials as part of counseling efforts. Consider exercise tolerance or simulated work testing for patients with heavy labor jobs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Consistently encourage patients to accumulate 30 to 60 minutes per day of moderate-intensity physical activity on &ge;5 (preferably most) days of the week. Explore daily schedules to suggest how to incorporate increased activity into usual routine (eg, parking farther away from entrances, walking &ge;2 flights of stairs, and walking during lunch break).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Advise low-impact aerobic activity to minimize risk of musculoskeletal injury. Recommend gradual increases in the volume of physical activity over time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Caution patients to avoid performing unaccustomed vigorous physical activity (eg, racquet sports and manual snow removal). Reassess the patient's ability to perform such activities as exercise training program progresses.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient shows increased participation in domestic, occupational, and recreational activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient shows improved psychosocial well-being, reduction in stress, facilitation of functional independence, prevention of disability, and enhancement of opportunities for independent self-care to achieve recommended goals.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient shows improved aerobic fitness and body composition and lessens coronary risk factors (particularly for the sedentary patient who has adopted a lifestyle approach to regular physical activity).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Exercise training",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Symptom-limited exercise testing prior to participation in an exercise-based cardiac rehabilitation program is strongly recommended. The evaluation may be repeated as changes in clinical condition warrant. Test parameters should include assessment of heart rate and rhythm, signs, symptoms, ST-segment changes, hemodynamics, perceived exertion, and exercise capacity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        On the basis of patient assessment and the exercise test if performed, risk stratify the patient to determine the level of supervision and monitoring required during exercise training. Use risk stratification schema as recommended by the AHA and the AACVPR.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Interventions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Develop an individualized exercise prescription for aerobic and resistance training that is based on evaluation findings, risk stratification, comorbidities (eg, peripheral arterial disease and musculoskeletal conditions), and patient and program goals. The exercise regimen should be reviewed by the program medical director or referring physician, modified if necessary, and approved. Exercise prescription should specify frequency (F), intensity (I), duration (D), modalities (M), and progression (P).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; For aerobic exercise: F=3-5 days/wk; I=50-80 percent of exercise capacity; D=20-60 minutes; and M=walking, treadmill, cycling, rowing, stair climbing, arm/leg ergometry, and others using continuous or interval training as appropriate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; For resistance exercise: F=2-3 days/wk; I=10-15 repetitions per set to moderate fatigue; D=1-3 sets of 8-10 different upper and lower body exercises; and M=calisthenics, elastic bands, cuff/hand weights, dumbbells, free weights, wall pulleys, or weight machines.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Include warm-up, cool-down, and flexibility exercises in each exercise session.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Provide progressive updates to the exercise prescription and modify further if clinical status changes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Supplement the formal exercise regimen with activity guidelines as outlined in the Physical Activity Counseling section of this table.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Expected outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient understands safety issues during exercise, including warning signs/symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient achieves increased cardiorespiratory fitness and enhanced flexibility, muscular endurance, and strength.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient achieves reduced symptoms, attenuated physiologic responses to physical challenges, and improved psychosocial well-being.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Patient achieves reduced global cardiovascular risk and mortality resulting from an overall program of cardiac rehabilitation/secondary prevention that includes exercise training.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Balady GJ, Williams MA, Ades PA, et al. Circulation 2007;115:2675. Copyright 2007 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
