" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Diagnosis and management of pleural causes of unexpandable lung",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
