var title_f3_62_4074="C1 and C2 bone anatomy";
var content_f3_62_4074=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F61029&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F61029&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 634px\">",
"   <div class=\"ttl\">",
"    C1 and C2 bone anatomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 614px; height: 622px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Observe the occipital condyles that articulate with the superior articular surfaces (facets) of the atlas (vertebra C1).",
"    <br>",
"     (B) The atlas, on which the cranium rests, has neither a spinous process nor a body. It consists of two lateral masses connected by anterior and posterior arches.",
"     <br>",
"      (C, D) The tooth-like dens characterizes the axis (vertebra C2) and provides a pivot around which the atlas turns and carries the cranium. It articulates anteriorly with the anterior arch of the atlas (\"Facet for dens\" in part B) and posteriorly with the transverse ligament of the atlas (see part B).",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Moore KL, Dalley AF. Clinically Oriented Anatomy, 5th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"      </div>",
"      <div class=\"contractual\">",
"       <br/>",
"       <a href=\"file://www.lww.com\">",
"        file://www.lww.com",
"       </a>",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
